import React, { useState } from 'react';
import './Payment.css';
import Navbar from '../Components/Navbar';

const PaymentForm = () => {
  const [fullName, setFullName] = useState('');
  const [email, setEmail] = useState('');
  const [address, setAddress] = useState('');
  const [city, setCity] = useState('');
  const [district, setDistrict] = useState('');
  const [cardNumber, setCardNumber] = useState('');
  const [expMonth, setExpMonth] = useState('');
  const [expYear, setExpYear] = useState('');
  const [cvv, setCvv] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here (e.g., send data to backend or process payment)
    console.log('Form submitted:', { fullName, email, address, city, district, cardNumber, expMonth, expYear, cvv });
    // Reset form fields
    setFullName('');
    setEmail('');
    setAddress('');
    setCity('');
    setDistrict('');
    setCardNumber('');
    setExpMonth('');
    setExpYear('');
    setCvv('');
  };

  return (
    <>
    <header className="Payment">
      <div className="container-Payment">
        <div className="left">
          <h3>PAYER DETAILS</h3>
          <form onSubmit={handleSubmit}>
            <br />
            Full name
            <input
              className="input-1"
              type="text"
              value={fullName}
              onChange={(e) => setFullName(e.target.value)}
              placeholder="Enter name"
              required
            />
            Email
            <input
              className="input-1"
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="Enter email"
              required
            />
            Address
            <input
              className="input-1"
              type="text"
              value={address}
              onChange={(e) => setAddress(e.target.value)}
              placeholder="Enter address"
              required
            />
            Your Place
            <input
              className="input-1"
              type="text"
              value={city}
              onChange={(e) => setCity(e.target.value)}
              placeholder="Enter City"
              required
            />
            <div id="zip">
              <label>
                District
                <select
                  value={district}
                  onChange={(e) => setDistrict(e.target.value)}
                  required
                >
                  <option value="">Choose Your District..</option>
                  <option value="Vavuniya">Vavuniya</option>
                  <option value="Jaffna">Jaffna</option>
                  <option value="Colombo">Colombo</option>
                  <option value="Mannar">Mannar</option>
                </select>
              </label>
            </div>
          </form>
        </div>
        <div className="right">
          <h3>PAYMENT</h3>
          <form onSubmit={handleSubmit}>
            Accepted Card <br />
            <br />
            Credit card number
            <input
              className="input-1"
              type="text"
              value={cardNumber}
              onChange={(e) => setCardNumber(e.target.value)}
              placeholder="Enter card number"
              required
            />
            Exp month
            <input
              className="input-1"
              type="text"
              value={expMonth}
              onChange={(e) => setExpMonth(e.target.value)}
              placeholder="Enter Month"
              required
            />
            <div id="zip">
              <label>
                Exp year
                <select
                  value={expYear}
                  onChange={(e) => setExpYear(e.target.value)}
                  required
                >
                  <option value="">Choose Year..</option>
                  <option value="2022">2022</option>
                  <option value="2023">2023</option>
                  <option value="2024">2024</option>
                  <option value="2025">2025</option>
                </select>
              </label>
              <label>
                CVV
                <input
                  className="input-1"
                  type="number"
                  value={cvv}
                  onChange={(e) => setCvv(e.target.value)}
                  placeholder="CVV"
                  required
                />
              </label>
            </div>
            <input className="input-1" type="submit" value="SUBMIT" />
          </form>
        </div>
      </div>
    </header>
    </>
  );
};

export default PaymentForm;
